import logo from './logo.svg';
import './App.css';
import { Grid } from '@mui/material';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./component/Home"

function App() {
  return (
    <Grid>
 <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          </Routes>
      </BrowserRouter>
    </Grid>
  );
}

export default App;
